    static func randGroup() -> Secp256k1Group {
        var g: Secp256k1Group? = nil
        while g == nil || !g!.isValidJ() || g!.isInfinity {
            let x = FieldTests.randField()
            let z = FieldTests.randField()
            let z2 = Secp256k1Field.sqr(z)
            let x3 = x * x * x
            let z6 = z2 * z2 * z2
            let y2 = x3 + z6 * Secp256k1Group.curvB
            let y = Secp256k1Field.sqrt(y2)
            g = y == nil ? nil : Secp256k1Group(x: x, y: y!, z: z)!
        }
        return g!
    }
    
    func testGroupOpsJ() {
        for _ in 0..<TestUtils.randTestCount*4 {
            let g1 = Self.randGroup()
            XCTAssertTrue(g1.isValidJ())
            XCTAssertFalse(g1.isInfinity)
            XCTAssertFalse(g1.z.isOne())
            let g2 = Self.randGroup()
            XCTAssertTrue(g2.isValidJ())
            XCTAssertFalse(g2.isInfinity)
            XCTAssertFalse(g2.z.isOne())
            
            var g1n = g1
            g1n.normalizeJ()
            XCTAssertTrue(g1n.isValid())
            XCTAssertFalse(g1n.isInfinity)
            XCTAssertTrue(g1n.z.isOne())
            
            var g2n = g2
            g2n.normalizeJ()
            XCTAssertTrue(g2n.isValid())
            XCTAssertFalse(g2n.isInfinity)
            XCTAssertTrue(g2n.z.isOne())
            
            var g1pg2n = g1n
            g1pg2n.add(g2n)
            XCTAssertTrue(g1pg2n.isValid())
            XCTAssertFalse(g1pg2n.isInfinity)
            XCTAssertTrue(g1pg2n.z.isOne())
            
            var g1pg2j = g1
            g1pg2j.addJ(g2)
            XCTAssertTrue(g1pg2j.isValidJ())
            XCTAssertFalse(g1pg2j.isInfinity)
            XCTAssertFalse(g1pg2j.z.isOne())
            
            var g1pg2jn = g1pg2j
            g1pg2jn.normalizeJ()
            XCTAssertTrue(g1pg2jn.isValid())
            XCTAssertFalse(g1pg2jn.isInfinity)
            XCTAssertTrue(g1pg2jn.z.isOne())
            
            XCTAssertEqual(g1pg2jn, g1pg2n)
            
            // add affine to j
            var g1jpg2 = g1
            g1jpg2.addAffine2J(g2n)
            XCTAssertTrue(g1pg2j.isValidJ())
            XCTAssertFalse(g1pg2j.isInfinity)
            XCTAssertFalse(g1pg2j.z.isOne())
            g1jpg2.normalizeJ()
            XCTAssertTrue(g1jpg2.isValid())
            XCTAssertFalse(g1jpg2.isInfinity)
            XCTAssertTrue(g1jpg2.z.isOne())
            
            XCTAssertEqual(g1jpg2, g1pg2n)
            
            // add infinity to j
            var g1jpinf = g1
            g1jpinf.addJ(Secp256k1Group())
            XCTAssertTrue(g1jpinf.isValidJ())
            XCTAssertFalse(g1jpinf.isInfinity)
            g1jpinf.normalizeJ()
            XCTAssertEqual(g1jpinf, g1n)
            
            // double
            var g1dn = g1n
            g1dn.double()
            XCTAssertTrue(g1dn.isValid())
            XCTAssertFalse(g1dn.isInfinity)
            XCTAssertTrue(g1dn.z.isOne())
            
            var g1dj = g1
            g1dj.doubleJ()
            XCTAssertTrue(g1dj.isValidJ())
            XCTAssertFalse(g1dj.isInfinity)
            XCTAssertFalse(g1dj.z.isOne())
            
            var g1djn = g1dj
            g1djn.normalizeJ()
            XCTAssertTrue(g1djn.isValid())
            XCTAssertFalse(g1djn.isInfinity)
            XCTAssertTrue(g1djn.z.isOne())
            
            XCTAssertEqual(g1djn, g1dn)
        }
    }
    
    func testDoublingEqsAddions() {
        let aVector: [[UInt64]] = [[0x7e00fcffffff, 0xf0ff7f000000, 0xffffffffffffff0f, 0x4000000000e0ff], [0x5747e9ab1ea0d93d, 0xe5af95824b6feaff, 0x6e9fdaf96207ac84, 0xdf2a39ec9abce698]]
        
        var isOverflow = false
        let a_x = Secp256k1Field(words64: aVector[0], overflowed: &isOverflow)
        XCTAssertFalse(isOverflow)
        let a_y = Secp256k1Field(words64: aVector[1], overflowed: &isOverflow)
        XCTAssertFalse(isOverflow)
        let a = Secp256k1Group(x: a_x, y: a_y)!
        XCTAssertTrue(a.isValid())
        XCTAssertFalse(a.isInfinity)
        
        var a8 = a
        a8.doubleJ()
        a8.doubleJ()
        a8.doubleJ()
        XCTAssertTrue(a8.isValidJ())
        XCTAssertFalse(a8.isInfinity)
        
        var aaaaaaaa = a
        aaaaaaaa.doubleJ()
        aaaaaaaa.addJ(a)
        aaaaaaaa.addJ(a)
        aaaaaaaa.addJ(a)
        aaaaaaaa.addJ(a)
        aaaaaaaa.addJ(a)
        aaaaaaaa.addJ(a)
        XCTAssertTrue(aaaaaaaa.isValidJ())
        XCTAssertFalse(aaaaaaaa.isInfinity)
        
        a8.normalizeJ()
        aaaaaaaa.normalizeJ()
        
        XCTAssertEqual(a8, aaaaaaaa)
    }
    
    func testGroupDecompress() {
        var goodCount = 0
        for _ in 0..<TestUtils.randTestCount*4 {
            let x = FieldTests.randField()
            
            let yAny = Secp256k1Group(x: x)
            let yOdd = Secp256k1Group(x: x, odd: true)
            let yEven = Secp256k1Group(x: x, odd: false)
            
            XCTAssertEqual(yAny != nil, yOdd != nil)
            XCTAssertEqual(yAny != nil, yEven != nil)
            
            if yAny == nil {
                continue
            }
            
            goodCount += 1
            
            XCTAssertFalse(yAny!.isInfinity)
            XCTAssertFalse(yEven!.isInfinity)
            XCTAssertFalse(yOdd!.isInfinity)
            XCTAssertEqual(yAny!.x, x)
            XCTAssertEqual(yEven!.x, x)
            XCTAssertEqual(yOdd!.x, x)
            
            XCTAssertTrue(yEven!.y.isEven());
            XCTAssertFalse(yOdd!.y.isEven());
            
            XCTAssertTrue(yAny!.isValid())
            XCTAssertTrue(yEven!.isValid())
            XCTAssertTrue(yOdd!.isValid())
        }
        XCTAssertTrue(goodCount > 32)
        
    }
